import React from 'react'
import { useParams } from 'react-router-dom'
import { data } from '../data/data';

const Page = () => {
    const {id} = useParams();
  return (
    <div>
        {data.map(item => item.id === id && <p>{item.description}</p>)}
    </div>
  )
}

export default Page
